import React from 'react';
import './Section.css';

function Cats() {
  return (
    <div className="section cats">
      <h2>Cats</h2>
      <p>Your cute furry friends!</p>
      <p>
        Explore our selection of products for your feline companions. From high-quality cat food to cozy beds and engaging toys, we have all the essentials for your cat.
      </p>
      <button>Shop Now</button>
    </div>
  );
}

export default Cats;
